import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Wait for a product price element using a different selector strategy
    // We'll look for the first occurrence of a price using XPath for a span with class 'product-price'
    await page.waitForSelector('//span[contains(@class,"product-price")]', { timeout: 5000 });

    // Take a screenshot after waiting for prices
    const pricesVisibleShot = path.join(screenshotsDir, 'step_2_prices_visible.png');
    await page.screenshot({ path: pricesVisibleShot });
    screenshots.push(pricesVisibleShot);

    // Extract all product prices using XPath (to ensure a different strategy)
    const priceHandles = await page.$$('//span[contains(@class,"product-price")]');
    const prices = [];
    for (const handle of priceHandles) {
      const text = await handle.textContent();
      if (text && text.trim().length > 0) {
        // Remove $ and whitespace, keep as string for verification
        prices.push(text.trim());
      }
    }

    // As additional verification, also try to extract prices from grid/list view using a different selector
    // Try to get all elements with class 'original-price' as well (for discounted products)
    const originalPriceHandles = await page.$$('//span[contains(@class,"original-price")]');
    const originalPrices = [];
    for (const handle of originalPriceHandles) {
      const text = await handle.textContent();
      if (text && text.trim().length > 0) {
        originalPrices.push(text.trim());
      }
    }

    // Take a screenshot after extraction
    const extractedShot = path.join(screenshotsDir, 'step_3_prices_extracted.png');
    await page.screenshot({ path: extractedShot });
    screenshots.push(extractedShot);

    return {
      success: true,
      action: "Extracted all product prices from the page using XPath and class selectors.",
      extractedData: {
        prices,
        originalPrices
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
